export function updateProfileRequest(data) {
	return {
		type: '@user/UPDATE_PROFILE_REQUEST',
		payload: { data },
	};
}

export function updateProfileSuccess(name, email, password, phone, zipcode, street, number, complement, district, city, state) {
	return {
		type: '@user/UPDATE_PROFILE_SUCCESS',
		payload: { name, email, password, phone, zipcode, street, number, complement, district, city, state },
	};
}

export function updateProfileFailure() {
	return {
		type: '@user/UPDATE_PROFILE_FAILURE',
	};
}
